var NewComponent = React.createClass({
  render: function() {
    return (
      <div>
        import React, {'{'} useState, useEffect {'}'} from 'react'
        import axios from 'axios'
        function Login(props) {'{'}
        // API fetching
        const [data, setData]=useState([])
        const fetchData = () =&gt; {'{'}
        fetch('http://localhost:4000/show')
        .then((res) =&gt; res.json())
        .then((response) =&gt; {'{'}
        console.log(response);
        setData(response);
        {'}'});
        {'}'}
        const [user,setUser]=useState({'{'}
        name:"",
        description:"",
        activitytype:"",
        duration:"",
        date:""
        {'}'})
        const handleChange = (event) =&gt; {'{'}
        setUser({'{'} ...user, [event.target.name]: event.target.value {'}'});
        {'}'};
        console.log(user)
        const [edit, setEdit]=useState(false)
        const [editid,setEditid]=useState("")
        const onSubmit = (e) =&gt; {'{'}
        e.preventDefault();
        if (edit) {'{'}
        axios
        .put(`http://localhost:4000/update/${'{'}editid{'}'}`, user)
        .then(res =&gt; {'{'}
        setEdit(false);
        setUser({'{'}
        name:"",
        description:"",
        activity:"",
        duration:"",
        date:""
        {'}'});
        fetchData();
        {'}'});
        {'}'} else {'{'}
        axios
        .post('http://localhost:4000/create', user)
        .then(res =&gt; {'{'}
        setUser({'{'}
        name:"",
        description:"",
        activity:"",
        duration:"",
        date:""
        {'}'});
        fetchData();
        {'}'});
        {'}'}
        {'}'};
        const editData = (id) =&gt; {'{'}
        let newUser = data.find(element =&gt; {'{'}
        return element._id === id;
        {'}'});
        setEdit(true);
        setEditid(id);
        setUser({'{'}
        name: newUser.name,
        description: newUser.description,
        activity: newUser.activity,
        duration:newUser.duration,
        date:newUser.date
        {'}'});
        {'}'};
        // Delete Data
        const deleteData = (id) =&gt; {'{'}
        axios
        .delete(`http://localhost:4000/delete/${'{'}id{'}'}`)
        .then(res =&gt; {'{'}
        fetchData();
        {'}'});
        {'}'};
        useEffect(()=&gt;{'{'}
        fetchData();
        {'}'},[])
        return (
        <div>
          <form classname="image" onsubmit="{onSubmit}">
            <div classname="container col-6 p-5">
              <div classname="form-group">
                <label>Name</label>
                <input type="text" classname="form-control" defaultValue="{user.name}" name="name" onchange="{handleChange}/" />
              </div>
              <div classname="form-group">
                <label>Description</label>
                <input type="text" classname="form-control" defaultValue="{user.description}" name="description" onchange="{handleChange}/" />
              </div>
              <div classname="form-group">
                <label>Activity Type</label>
                <div>
                  <select classname="custom-select" id="inputGroupSelect04" value="{user.activitytype}" name="activitytype" onchange="{handleChange}">
                    <option selected>Choose...</option>
                    <option value="run">Run</option>
                    <option value="bicycle">Bicycle Ride</option>
                    <option value="swim">Swim</option>
                    <option value="walk">Walk</option>
                    <option value="hike">Hike</option>
                  </select>
                </div>
              </div>
              <div classname="form-group">
                <label>Duration</label>
                <input type="time" classname="form-control" defaultValue="{user.duration}" name="duration" onchange="{handleChange}/" />
              </div>
              <div classname="form-group">
                <label>Date</label>
                <input type="date" classname="form-control" defaultValue="{user.date}" name="date" onchange="{handleChange}/" />
              </div>
              <div classname="form-group">
                <input type="submit" classname="btn btn-success" />
              </div>
            </div>
          </form>
          <div>
            <div classname="row">
              <div classname="card-deck">
                {'{'}
                data.map((u,i)=&gt;(
                <div classname="col-md-4" key="{i}">
                  <div classname="card mb-4">
                    <div classname="card-body">
                      <p classname="card-title">{'{'}u.name{'}'}</p>
                      <p>{'{'}u.activitytype{'}'}</p>
                      <p>{'{'}u.duration{'}'}</p>
                      <p>{'{'}u.date{'}'}</p>
                      <p classname="card-text">{'{'}u.description{'}'}</p>
                      <button to="#" classname="btn btn-primary" onclick="{()=">editData(u._id){'}'}&gt;Edit</button>
                      <button to="#" classname="btn btn-danger" onclick="{()=">deleteData(u._id){'}'}&gt;Delete</button>
                    </div>
                  </div>
                </div>
                )){'}'}
              </div>
            </div>
          </div>
        </div>
        )
        {'}'}
        export default Login
      </div>
    );
  }
});
